import styled from "styled-components";

export const BaseIcon = stlyed.img`
  height: fit-content;
  border-radius: 2px;
  box-shadow: 0 2px 7px 0 rgba(0, 0, 0, 0.15);
  position:absolute;

`;

export const DeclinedIcon = styled(BaseIcon)`
  background-color: #e25e5e;
`;
export const ApprovedIcon = styled(BaseIcon)`
  background-color: #41d94e;
`;
export const WaitingIcon = styled(BaseIcon)`
  background-color: #fc913f;
`;
export const TotalIcon = styled(BaseIcon)`
  d-color: #1890ff;
`;

export const UserIcon = styled.img`
  width: 24px;
  height: 24px;
  margin: 0 0 0 10px;
  padding: 4px 3px 3px 4px;
  background-color: #1890ff;
  border-radius: 50%;
`;

export const BellIcon = styled.img``;
